import React from "react";

const masterRoutes = [

    //User
    {
        path: "/master/user/list",
        component: React.lazy(() => import("./commune/UserList")),
    },
    {
        path: "/master/user/:viewType/:id?",
        component: React.lazy(() => import("./commune/UserFormDetails")),
    },

];

export default masterRoutes;
